<!DOCTYPE html>
<html lang="es">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Inicio</title>
    <link rel="stylesheet" href="../CSS/style.css">
    <link rel="stylesheet" href="../CSS/styleMapa.css">
    <script src="../SCRIPS/scripadmin.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/sweetalert2@11"></script>

    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        .modal {
            display: none;
            position: fixed;
            z-index: 1000;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0, 0, 0, 0.5);
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .modal-content {
            background-color: white;
            padding: 20px;
            border-radius: 10px;
            text-align: center;
            width: 300px;
        }



        .btn-hoy {
            background-color: #363836;
            color: white;
        }

        .btn-seleccionar {
            background-color: #363836;
            color: white;
        }

        .btn-cerrar {
            background-color: #f44336;
            color: white;
        }
    </style>
</head>

<body class="inicio">

    <div class="taskbar">
        <img src="https://cdn-icons-png.flaticon.com/128/619/619153.png" class="icon" onclick="openInicio()">
        <img src="https://cdn-icons-png.flaticon.com/128/2991/2991231.png" class="icon" onclick="openMapa()">
        <img src="https://cdn-icons-png.flaticon.com/128/2921/2921222.png" class="icon" onclick="openExhibidor()">
        <img src="https://cdn-icons-png.flaticon.com/128/706/706797.png" class="icon" onclick="openUsuarios()">
        <img src="https://cdn-icons-png.flaticon.com/128/732/732220.png" class="icon" onclick="openRegistro()">

    </div>

    <div id="fechaModal" class="modal" style="display: none;">
        <div class="modal-content">
            <h3>Selecciona una fecha</h3><br>
            <button class="btn-hoy" onclick="setFechaHoy()">Fecha de hoy</button>
            <button class="btn-seleccionar" onclick="mostrarInputFecha()">Seleccionar fecha</button>
            <br>
            <input type="date" id="fechaInput" style="display: none;" onchange="guardarFecha()">
            <br>
            <button class="btn-cerrar" onclick="cerrarModal()">Cancelar</button>
        </div>
    </div>


    <div class="menu" id="appinicio">
        <h1>Crear Territorio</h1><br>
        <hr><br>
        <input type="text" id="nombremapa" class="input-crear" placeholder="Ingrese el nombre"><br><br>

        <button id="CrearBoton" class="crear-btn" onclick="crearmapa()">Crear</button><br>
        <hr><br>
        <button id="salir" class="crear-btn" onclick="salir()">Cerrar sesión</button><br><hr>
    </div>

    <div class="menu" id="appexhibidor">
        <h1>Exhibidores</h1>
        <div id="listaExhibidores">
            <button class="crear-btn" onclick="mostrarModal(this)">Exhibidor_H_Eloina</button><br>
            <button class="crear-btn" onclick="mostrarModal(this)">Exhibidor_FCastañeda</button><br>
            <button class="crear-btn" onclick="mostrarModal(this)">Exhibidor_Parquesito</button><br>
            <button class="crear-btn" onclick="mostrarModal(this)">Exhibidor_Donde_Toño</button><br>
        </div>
    </div>

    <div class="menu" id="appusuarios">
        <h1>Usuarios</h1> <br><button class="crear-btn" onclick="crearUsuario()" >Crear Usuario</button >
        <div id="listaUsuarios"></div>
    </div>

    <div class="menu" id="appregistro">
        <h1>Registro</h1><br>
        <button id="botonExhibidores" class="Boton_edit" onclick="registroExhibidores()">Exhibidores</button>
        <button id="botonTerritorio" class="Boton_edit" onclick="registroTerritorios()">Territorios</button>

        <div id="registroTerritorio" class="registroTerritorio" style="display: none; margin-top: -70px;">

            <div id="listaMapasRegistro"></div>



            <div id="botonesRegistroTerritorios" class="botonesRegistroTerritorios"
                style="display: none; margin-top: -100px;">
                <button style="display: block; width: 100%;
                padding: 10px;
                margin: 200px 0 5px 0;
                background-color: #3f454b;
                color: white;
                border: none;
                border-radius: 5px;
                cursor: pointer;
                font-size: 16px;" class="botoneliminarterri" id="botoneliminarterri"
                    onclick="clickEliminarTerritorio()">Eliminar</button>

                    <button style="display: block; width: 100%;
                padding: 10px;
                margin: 100px 0 5px 0;
                background-color: #3f454b;
                color: white;
                border: none;
                border-radius: 5px;
                cursor: pointer;
                font-size: 16px;" class="botoneliminarterri" id="botoneliminarterri"
                    onclick="clickVistaTerritorio()">Vista</button>
            </div>
          


        </div>
        <div id="Lista" class="Lista" style="display: none; margin-top: 10px;">
            <button class="crear-btn" onclick="resgistroEloina()">Exhibidor_Hermana_Eloina</button><br>
            <button class="crear-btn" onclick="registroCastañeda()">Exhibidor_Fla_Castañeda</button><br>
            <button class="crear-btn" onclick="registroParquesito()">Exhibidor_Parquesito</button><br>
            <button class="crear-btn" onclick="registroToño()">Exhibidor_Donde_Toño</button><br>
        </div>
        


        <div id="selecctordeFecha" class="selecctordeFecha" style="display: none; margin-top: 10px;">

            <div class="año">
            <label for="año">Selecciona un año:</label>
            <select id="año" onchange="añoSeleccionado()">
                <option value="SELECCIONA">SELECCIONA</option>
                <option value="2025">2025</option>
                <option value="2026">2026</option>
            </select>
        </div>
        <div id="mes" class="mes" style="display: none; margin-top: 10px;">
            <label for="mes">Selecciona un mes:</label>
            <select id="mess" onchange="mesSeleccionado()">
                <option value="SELECCIONA">SELECCIONA</option>
                <option value="Enero">Enero</option>
                <option value="Febrero">Febrero</option>
                <option value="Marzo">Marzo</option>
                <option value="Abril">Abril</option>
                <option value="Mayo">Mayo</option>
                <option value="Junio">Junio</option>
                <option value="Julio">Julio</option>
                <option value="Agosto">Agosto</option>
                <option value="Septiembre">Septiembre</option>
                <option value="Octubre">Octubre</option>
                <option value="Noviembre">Noviembre</option>
                <option value="Diciembre">Diciembre</option>
            </select>
        </div>
        <div id="datos" class="datos" style="display: none; margin-top: 10px;">
            <p id="usos">Usos: 0</p><br>
            <select id="exhibidoresLista" onchange="registrodeElExhibidor()">
                <option>SELECCIONA</option>
            </select><br>

            <button class="crear-btn" onclick="EliminarRegistroExhibidor()">Eliminar</button>
        </div>
        </div>

        <div id="registroExhibidores" class="registroExhibidores" style="display: none; margin-top: -70px;">

            <div id="listaExhibidoresRegistro"></div>



            <div id="botonesRegistroTerritorios" class="botonesRegistroTerritorios"
                style="display: none; margin-top: -100px;">
                <button style="display: block; width: 100%;
                padding: 10px;
                margin: 200px 0 5px 0;
                background-color: #3f454b;
                color: white;
                border: none;
                border-radius: 5px;
                cursor: pointer;
                font-size: 16px;" class="botoneliminarterri" id="botoneliminarterri"
                    onclick="clickEliminarTerritorio()">Eliminar</button>

            </div>

        </div>


    </div>

                window.location.href = "../index.html";
            }
        });

        document.getElementById("gruposelect").addEventListener("change", function () {
            let selectedValue = this.value;
            let groupNumber = selectedValue.replace("grupo", "");
            localStorage.setItem("Centro", groupNumber);


            for (let i = 1; i <= 4; i++) {
                let mapa = document.querySelector(".mapaCentro" + i);
                if (mapa) {
                    mapa.style.display = "none";
                }
            }

            let numeros = localStorage.getItem("Centro");
            let nombre = localStorage.getItem("Territorio");

            let selectedMap = document.querySelector(".mapaCentro" + numeros);

            if (selectedMap) {
                selectedMap.style.display = "block";
                let url = `http://127.0.0.1:8000/getVistaMapas?territorio=${encodeURIComponent(nombre)}&grupo=${encodeURIComponent(numeros)}`;

                fetch(url)
                    .then(response => response.json())
                    .then(data => {
                        Object.keys(data).forEach(mapa => {
                            const pathElement = document.getElementById(mapa);
                            if (pathElement) {
                                if (data[mapa] === "no") {
                                    pathElement.setAttribute("fill", "green");
                                } else if (data[mapa] === "sí") {
                                    pathElement.setAttribute("fill", "red");
                                } else if (data[mapa] === "falta") {
                                    pathElement.setAttribute("fill", "yellow");
                                }
                            }
                        });
                    })
                    .catch(error => console.error("Error al buscar los mapas:", error));
            }
        });

                        let nombre = this.id;
                        let territorio = localStorage.getItem("Territorio");

                        showSelectionDialog()
                            .then(opcion => {
                                if (!opcion) return;

                                let nuevoValor = null;
                                let nuevoColor = "green";
                                let nuevoHecho = "no";

                                if (opcion === "realizada") {
                                    nuevoColor = "red";
                                    nuevoValor = new Date().toISOString().split("T")[0];
                                    nuevoHecho = "sí";
                                } else if (opcion === "incompleta") {
                                    nuevoColor = "yellow";
                                    nuevoValor = new Date().toISOString().split("T")[0];
                                    nuevoHecho = "falta";
                                }

                                this.setAttribute("fill", nuevoColor);

                                if (!territorio || !nombre || !nuevoHecho) {
                                    console.error("Datos inválidos para la actualización");
                                    return;
                                }

                                let username = localStorage.getItem("username");


                                fetch("http://127.0.0.1:8000/updateMapa", {
                                    method: "PUT",
                                    headers: { "Content-Type": "application/json" },
                                    body: JSON.stringify({
                                        territorio: territorio,
                                        mapa: nombre,
                                        fecha: nuevoValor,
                                        hecho: nuevoHecho,
                                        username: username
                                    })
                                })
                                    .then(response => response.json())
                                    .then(data => alert(data.message))
                                    .catch(error => console.error("Error al actualizar el mapa:", error));
                            })
                            .catch(error => console.error("Error al seleccionar opción:", error));
                    }


                });
            });

        function showSelectionDialog() {
            return new Promise((resolve) => {
                const modal = document.createElement("div");
                modal.innerHTML = `
            <div style="position: fixed; top: 50%; left: 50%; transform: translate(-50%, -50%);
                        background: white; padding: 20px; box-shadow: 0px 0px 10px rgba(0,0,0,0.3);
                        border-radius: 10px; text-align: center; z-index: 1000;">
                <h3>Edita estado de la Manzana</h3>
                <button id="realizada" style="background: red; color: white; margin: 5px; padding: 10px;">Manzana Realizada</button>
                <button id="incompleta" style="background: yellow; color: black; margin: 5px; padding: 10px;">Manzana Incompleta</button>
                <button id="no_realizada" style="background: green; color: white; margin: 5px; padding: 10px;">Manzana No Realizada</button>
            </div>
        `;
                document.body.appendChild(modal);

                document.getElementById("realizada").addEventListener("click", () => {
                    document.body.removeChild(modal);
                    resolve("realizada");
                });

                document.getElementById("incompleta").addEventListener("click", () => {
                    document.body.removeChild(modal);
                    resolve("incompleta");
                });

                document.getElementById("no_realizada").addEventListener("click", () => {
                    document.body.removeChild(modal);
                    resolve("no");
                });
            });
        }



        document.addEventListener("DOMContentLoaded", function () {
            fetch('http://127.0.0.1:8000/usuarios')
                .then(response => response.json())
                .then(data => {
                    const listaUsuarios = document.getElementById("listaUsuarios");

                    let tablaHTML = `
                <table border="1">
                    <tr>
                        <th>Username</th>
                        <th>Rol</th>
                        <th>Eliminar</th>
                    </tr>
            `;

                    data.forEach(usuario => {
                        tablaHTML += `
                    <tr>
                        <td>${usuario.username}</td>
                        <td>${usuario.rol}</td>
                        <td>
                            <button class="eliminar" onclick="eliminarUsuario('${usuario.username}')">Eliminar</button>
                            <button class="editar" onclick="editarUsuario('${usuario.username}')">Editar</button>
                        </td>
                    </tr>
                `;
                    });

                    tablaHTML += `</table>`;
                    listaUsuarios.innerHTML = tablaHTML;
                })
                .catch(error => console.error("Error al obtener usuarios:", error));
        });


        function editarUsuario(username) {
            Swal.fire({
                title: `Editar a ${username}`,
                input: "radio",
                inputOptions: {
                    password: "Contraseña",
                    role: "Role"
                },
                inputValidator: (value) => {
                    if (!value) {
                        return "Debes seleccionar para editar";
                    }
                },
                showCancelButton: true,
                confirmButtonText: "Editar",
                cancelButtonText: "Cancelar"
            }).then((result) => {
                if (result.isConfirmed && result.value) {
                    let campo = result.value; 

                    if (campo === "password") {
                        editarUsuarioPassword(username);
                    } else if (campo === "role") {
                        editarUsuarioRol(username);
                    }
                } else {
                    Swal.fire("CANCELADA", "No se realizó ningún cambio.", "info");
                }
            });
        }


        function editarUsuarioPassword(username) {
            Swal.fire({
                title: `Editar contraseña de ${username}`,
                input: "password",
                inputPlaceholder: "Nueva contraseña",
                showCancelButton: true,
                confirmButtonText: "Actualizar",
                cancelButtonText: "Cancelar",
                inputValidator: (value) => {
                    if (value.length > 10) {
                        return "La contraseña debe tener menos de 10 caracteres";
                    }
                }
            }).then((result) => {
                if (result.isConfirmed) {
                    actualizarPassword(username, result.value);
                } else {
                    Swal.fire("CANCELADA", "No se realizó ningún cambio.", "info");
                }
            });
        }

        function actualizarPassword(username, nuevaPassword) {
            fetch(`http://127.0.0.1:8000/usuariosupdatepassword/${username}`, {
                method: "PUT",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({ password: nuevaPassword })
            })
                .then(response => response.json())
                .then(data => {
                    Swal.fire("Éxito", `La contraseña de ${username} ha sido actualizada.`, "success");
                    console.log(data);
                })
                .catch(error => {
                    Swal.fire("Error", "No se pudo actualizar la contraseña.", "error");
                    console.error("Error:", error);
                });
        }

        function editarUsuarioRol(username) {
            Swal.fire({
                title: `Selecciona un rol para ${username}`,
                input: "radio",
                inputOptions: {
                    administrador: "administrador",
                    capitan: "capitan",
                    exhibidor: "usuario"
                },
                inputValidator: (value) => {
                    if (!value) {
                        return "Debes seleccionar un rol";
                    }
                },
                showCancelButton: true,
                confirmButtonText: "Actualizar",
                cancelButtonText: "Cancelar"
            }).then((result) => {
                if (result.isConfirmed && result.value) {
                    actualizarRol(username, result.value);
                } else {
                    Swal.fire("CANCELADA", "No se realizó ningún cambio.", "info");
                }
            });
        }

        function actualizarRol(username, nuevoRol) {
            Swal.fire(`${username} ahora es ${nuevoRol.charAt(0).toUpperCase() + nuevoRol.slice(1)}.`);
            fetch(`http://127.0.0.1:8000/usuariosupdaterole/${username}`, {
                method: "PUT",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify({ nuevo_rol: nuevoRol })
            })
                .then(response => response.json())
                .then(data => console.log(data));
        }



    </script>
    <link rel="stylesheet" href="../CSS/styleMapa.css">
</body>

</html>
